import React from "react";
import { Link } from "react-router-dom";

import "./MainNav.css";

const MainNav = () => {
  return (
    <React.Fragment>
      <nav className="container navbar navbar-expand-lg navbar-light bg-light navbar-top">
        <ul className="navbar-nav mr-auto row ">
          <li className="nav-item active col-sm">
            <Link className="navbar-brand" to="/">
              <p className="display-3">Home</p>
            </Link>
          </li>
          <li className="nav-item col-sm navbar-left">
            <Link className="navbar-brand" to="/authors-articles">
              <p>AuthorsArt</p>
            </Link>
          </li>
        </ul>
      </nav>
    </React.Fragment>
  );
};

export default MainNav;
